import React from 'react';

const SearchBox = ({searchfield, searchSent, searchChange}) => {
	return (
		<div>
			<input 
				className='pa3 ba b--green bg-lightest-blue'
				type="search" 
				placeholder="Search"
				// onChange={searchChange}
				onKeyPress={searchChange}
				/>
			<button
				onClick={searchSent}>
				Search
			</button>
		</div>
	);
};

export default SearchBox;
